"use client";

import React, { useState, useEffect } from "react";
import { Sidebar } from "../components/Sidebar";

const dummyArticles = [
  {
    id: 1,
    title: "How to Improve Your Skills in League of Legends",
    keyword: "league of legends [2240000]",
    words: 4575,
    createdOn: "20 hours ago",
    publish: true,
  },
  {
    id: 2,
    title: "How to Master Last Hitting in League of Legends",
    keyword: "league of legends [2240000]",
    words: 3480,
    createdOn: "21 hours ago",
    publish: true,
  },
  {
    id: 3,
    title: "7 Tips for Better Teamplay in League of Legends",
    keyword: "league of legends [2240000]",
    words: 2678,
    createdOn: "6 days ago",
    publish: false,
  },
  {
    id: 4,
    title: "Top Virtual Executive Assistant Services (2024)",
    keyword: "virtual executive assistant [2900]",
    words: 2408,
    createdOn: "1 Oct, 24",
    publish: true,
  },
  {
    id: 5,
    title: "Unlimited Graphics Design Solutions",
    keyword: "unlimited graphic design services [390]",
    words: 1793,
    createdOn: "1 Oct, 24",
    publish: false,
  },
];

export function DashboardPage() {
  const [articles, setArticles] = useState([]);
  const [filter, setFilter] = useState("");
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    setLoading(true);
    setTimeout(() => {
      setArticles(dummyArticles);
      setLoading(false);
    }, 1000);
  }, []);

  const filteredArticles = articles.filter(
    (article) =>
      article.title.toLowerCase().includes(filter.toLowerCase()) ||
      article.keyword.toLowerCase().includes(filter.toLowerCase())
  );

  return (
    <div className="flex min-h-screen">
      <Sidebar />
      <main className="flex-1 p-6 bg-white">
        <div className="mb-4 text-2xl font-semibold">Articles</div>
        <div className="mb-4">
          <input
            type="text"
            placeholder="Search for Title & Keywords..."
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
            className="max-w-sm px-3 py-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
        </div>
        {loading ? (
          <div className="space-y-2 animate-pulse">
            <div className="h-6 bg-gray-200 rounded w-1/3"></div>
            <div className="h-6 bg-gray-200 rounded"></div>
            <div className="h-6 bg-gray-200 rounded"></div>
          </div>
        ) : filteredArticles.length > 0 ? (
          <table className="min-w-full border border-gray-200 rounded-md">
            <thead className="bg-gray-50">
              <tr>
                <th className="p-2 border-b border-gray-200">
                  <input type="checkbox" />
                </th>
                <th className="p-2 border-b border-gray-200 text-left">Article Title</th>
                <th className="p-2 border-b border-gray-200 text-left">Keyword (Traffic)</th>
                <th className="p-2 border-b border-gray-200 text-left">Words</th>
                <th className="p-2 border-b border-gray-200 text-left">Created On</th>
                <th className="p-2 border-b border-gray-200 text-left">Action</th>
                <th className="p-2 border-b border-gray-200 text-left">Publish</th>
              </tr>
            </thead>
            <tbody>
              {filteredArticles.map((article) => (
                <tr key={article.id} className="hover:bg-gray-100">
                  <td className="p-2 border-b border-gray-200 text-center">
                    <input type="checkbox" />
                  </td>
                  <td className="p-2 border-b border-gray-200">{article.title}</td>
                  <td className="p-2 border-b border-gray-200">{article.keyword}</td>
                  <td className="p-2 border-b border-gray-200">{article.words}</td>
                  <td className="p-2 border-b border-gray-200">{article.createdOn}</td>
                  <td className="p-2 border-b border-gray-200">
                    <button className="px-3 py-1 text-sm text-blue-600 border border-blue-600 rounded hover:bg-blue-50">
                      View
                    </button>
                  </td>
                  <td className="p-2 border-b border-gray-200">{article.publish ? "Yes" : "No"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <div className="text-center py-4">No results.</div>
        )}
      </main>
    </div>
  );
}
